    public static String exist(long[] s) {
		if(findCliqueBruteForce(s)) {
			return POSSIBLE;
		} else {
			return IMPOSSIBLE;
		}
	}
	
	private static boolean findCliqueBruteForce(long[] s) {
		for(int a = 0; a < s.length; a++) {
			for(int b = a+1; b < s.length; b++) {
				if((s[a] & s[b]) == 0) {
					continue;
				}
				for(int c = b+1; c < s.length; c++) {
					for(int d = c+1; d < s.length; d++) {
						if(isCliqueFour(s[a],s[b],s[c],s[d])) {
							return true;
						}
					}
				}
			}
		}
		return false;
	}

