	private static boolean isClique(long a, long b, long c) {
		return (a & b) > 0 && (b & c) > 0 && (a & c) > 0 && (a & b & c) == 0;
	}

	private static boolean isCliqueFour(long a, long b, long c, long d) {
		return (a & b) > 0 && (b & c) > 0 && (a & c) > 0 && (a & d) > 0 && (b & d) > 0 && (c & d) > 0 && (a & b & c & d) == 0;
	}
